import React from "react";
import Box from '@mui/material/Box';

function Signin(){

    return(

        <Box
      sx={{
        width: 850,
        height: 700,
        position:'relative',
        left:400,
        top:250,
        display:'flex',
        flexDirection:'row',
        border:'2px solid red'
         }}>
             <Box sx={{
                 width:400,
                 heigth:400,
                 border:'1px solid red',
                 backgroundColor: 'primary.dark',
             }}>

             </Box>
             <Box x={{
                 width:400,
                 heigth:600,
                 border:'1px solid red',
                 backgroundColor: 'primary.dark',
             }}>
                ></Box>
        </Box>
    )

}
export default Signin
